import React, {Component} from "react";

class BookmarkItem extends Component {
    render() {
        const {bookmark} = this.props;
        return (
            <tr>
                <td>{bookmark.name}</td>
                <td>{bookmark.rating}</td>
                <td>
                    <form>
                        <button className="btn btn-outline-warning"><i className="fa fa-fw fa-edit"></i></button>
                        <button className="btn btn-danger"><i className="fa fa-fw fa-trash"></i></button>
                    </form>
                </td>
            </tr>
        );
    }
}

export default BookmarkItem;
